contract/SimpleStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract SimpleStorage {
    string public word = "hello World!";

    struct People {
        string name;
        uint256 age;
    }

    People[] public people;

    function store(string memory _message) public {
        word = _message;
        //funtion retrieve called in here the gas free is increasely
        //retrieve();
    }

    //view annd pure is // Gas-free when called externally
    function retrieve() public view returns (string memory) {
        return string(abi.encodePacked(word, " COBA 1"));
    }

    function addPerson(string memory _name, uint256 _age) public {
        people.push(People(_name, _age));
    }

    function getAllPeople() public view returns (People[] memory) {
        return people;
    }
}

